    data: |
      SELECT ( - ( + col1 ) ) + + ( col0 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT CAST ( + col0 AS INTEGER ) * - + col2 / - 8 IS NOT NULL;
  - name: tab1

outputs:
  - name: q9585.out
    data: |
